    'help.HowDoIShareAnAdOnFacebookTwitterEtc_content': '\u0986\u09AA\u09A8\u09BF \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u099F\u09BF \u0996\u09CB\u09B2\u09BE\u09B0 \u09AA\u09B0 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u09C7\u09B0 \u099F\u09C7\u0995\u09CD\u09B8\u099F\u09C7\u09B0 \u09A8\u09BF\u099A\u09C7 \u09A6\u09C7\u0996\u09C1\u09A8\u0964 \u201C\u098F\u0987 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8 \u09B6\u09C7\u09DF\u09BE\u09B0 \u0995\u09B0\u09C1\u09A8\u201D \u09A8\u09BE\u09AE\u09C7 \u098F\u0995\u099F\u09BF \u0995\u09B2\u09BE\u09AE \u0986\u099B\u09C7\u0964 \u098F\u09B0 \u09A8\u09BF\u099A\u09C7 \u098F\u0995\u099F\u09BF \u09A4\u09BE\u09B2\u09BF\u0995\u09BE \u0986\u099B\u09C7 \u09AF\u09C7\u0996\u09BE\u09A8\u09C7 \u09A6\u09C7\u09DF\u09BE \u09A4\u09BE\u09B2\u09BF\u0995\u09BE\u09DF \u0995\u09CD\u09B2\u09BF\u0995 \u0995\u09B0\u09C7 \u0986\u09AA\u09A8\u09BE\u09B0 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8 \u09B6\u09C7\u09DF\u09BE\u09B0 \u0995\u09B0\u09A4\u09C7 \u09AA\u09BE\u09B0\u09AC\u09C7\u09A8; Facebook, Twitter, \u098F\u09AC\u0982 \u0987\u09AE\u09C7\u09B2\u09B8\u09B9 \u0986\u09B0\u09CB \u0985\u09A8\u09CD\u09AF\u09BE\u09A8\u09CD\u09AF\u0964',
    'help.HowDoIUploadAPicture': '\u0986\u09AE\u09BF \u0995\u09BF\u09AD\u09BE\u09AC\u09C7 \u099B\u09AC\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09AC?',
    'help.HowDoIUploadAPicture_content': '"\u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u09C7\u09B0 \u09AC\u09BF\u09B8\u09CD\u09A4\u09BE\u09B0\u09BF\u09B0\u09A4" \u09AA\u09BE\u09A4\u09BE\u09B0 \u09A8\u09BF\u099A\u09C7 \u09AF\u09C7\u0996\u09BE\u09A8\u09C7 \u0986\u09AA\u09A8\u09BF \u0986\u09AA\u09A8\u09BE\u09B0 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8 \u09AA\u09CB\u09B8\u09CD\u099F\u09BF\u0982\u098F\u09B0 \u09AB\u09B0\u09CD\u09AE \u09AA\u09C2\u09B0\u09A3 \u0995\u09B0\u09C7\u09A8, \u09B8\u09C7\u0996\u09BE\u09A8\u09C7 \u098F\u0995\u099F\u09BF \u09AC\u09BF\u09AD\u09BE\u0997 \u09AA\u09BE\u09AC\u09C7\u09A8 \u09AF\u09C7\u099F\u09BF \u0986\u09AA\u09A8\u09BE\u0995\u09C7 \u099B\u09AC\u09BF \u09AF\u09C1\u0995\u09CD\u09A4 \u0995\u09B0\u09BE\u09B0 \u0989\u09AA\u09BE\u09DF \u09A8\u09BF\u09B0\u09CD\u09AC\u09BE\u099A\u09A8\u09C7\u09B0 \u09B8\u09C1\u09AF\u09CB\u0997 \u09A6\u09C7\u09AC\u09C7\u0964 \u0986\u09AA\u09A8\u09BF "\u09AC\u09CD\u09B0\u09BE\u0989\u099C" \u09AC\u09CB\u09A4\u09BE\u09AE\u099F\u09BF\u09B0 \u0989\u09AA\u09B0 \u0995\u09CD\u09B2\u09BF\u0995 \u0995\u09B0\u09B2\u09C7 \u0986\u09AA\u09A8\u09BE\u09B0 \u0995\u09AE\u09CD\u09AA\u09BF\u0989\u099F\u09BE\u09B0\u09C7\u09B0 \u09B8\u09AC \u09AB\u09BE\u0987\u09B2 \u09A6\u09C7\u0996\u09BF\u09DF\u09C7 \u098F\u0995\u099F\u09BF \u099C\u09BE\u09A8\u09BE\u09B2\u09BE \u09AA\u09BE\u0993\u09DF\u09BE \u09AF\u09BE\u09AC\u09C7\u0964 \u09AF\u09C7 \u099B\u09AC\u09BF\u09B0 \u09AB\u09BE\u0987\u09B2\u099F\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09A4\u09C7 \u099A\u09BE\u09A8 \u09B8\u09C7\u099F\u09BF \u09A8\u09BF\u09B0\u09CD\u09AC\u09BE\u099A\u09A8 \u0995\u09B0\u09C1\u09A8 \u098F\u09AC\u0982 \u0996\u09C1\u09B2\u09C1\u09A8\u0964 \u098F\u09A4\u09C7 \u0986\u09AA\u09A8\u09BE\u09B0 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u09C7\u09B0 \u09B8\u0982\u09AF\u09CB\u099C\u09A8 \u09B9\u09BF\u09B8\u09BE\u09AC\u09C7 \u098F\u0995\u099F\u09BF \u099B\u09AC\u09BF\u09B0 \u09AB\u09BE\u0987\u09B2 \u09A4\u09C8\u09B0\u09BF \u09B9\u09AC\u09C7\u0964 \u0986\u09B0\u09CB \u099B\u09AC\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09A4\u09C7, \u09AA\u09B0\u09AC\u09B0\u09CD\u09A4\u09C0 "\u09AC\u09CD\u09B0\u09BE\u0989\u099C" \u09AC\u09CB\u09A4\u09BE\u09AE\u099F\u09BF\u09B0 \u0989\u09AA\u09B0 \u0995\u09CD\u09B2\u09BF\u0995 \u0995\u09B0\u09C1\u09A8\u0964 \u09AF\u09C7 \u099B\u09AC\u09BF\u099F\u09BF \u0986\u09AA\u09A8\u09BF \u09AA\u09CD\u09B0\u09A5\u09AE \u0985\u09AC\u09B8\u09CD\u09A5\u09BE\u09A8\u09C7 \u09A6\u09BF\u09DF\u09C7\u099B\u09BF\u09B2\u09C7\u09A8 \u09B8\u09C7\u099F\u09BF \u0986\u09AA\u09A8\u09BE\u09B0 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u09C7\u09B0 \u09AA\u09CD\u09B0\u09A7\u09BE\u09A8 \u099B\u09AC\u09BF \u09B9\u09AC\u09C7 \u098F\u09AC\u0982 \u09AC\u09BF\u09AD\u09BE\u0997 \u09A4\u09BE\u09B2\u09BF\u0995\u09BE\u09DF \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u09C7\u09B0 \u09B6\u09BF\u09B0\u09CB\u09A8\u09BE\u09AE\u09C7\u09B0 \u09AA\u09B0\u09C7\u0987 \u09A4\u09BE \u09A6\u09C7\u0996\u09BE \u09AF\u09BE\u09AC\u09C7\u0964 <br />OLX-\u098F \u099B\u09AC\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09BE\u09B0 \u09AA\u09A6\u09CD\u09A7\u09A4\u09BF \u09B8\u09B9\u099C \u098F\u09AC\u0982 \u0986\u09AA\u09A8\u09BF \u09AA\u09CD\u09B0\u09A4\u09BF \u09AA\u09CB\u09B8\u09CD\u099F\u09BF\u0982-\u098F <<NUMBER>> (<<NUMBER_IN_WORDS>>) \u09B8\u0982\u0996\u09CD\u09AF\u0995 \u099B\u09AC\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09A4\u09C7 \u09AA\u09BE\u09B0\u09C7\u09A8\u0964 \u099B\u09AC\u09BF \u0985\u09AA\u09C7\u0995\u09CD\u09B7\u09BE\u0995\u09C3\u09A4 \u09B9\u09BE\u09B2\u0995\u09BE, \u09AE\u09C2\u09B2\u09A4 \u09AA\u09CD\u09B0\u09A4\u09BF\u099F\u09BF <<WEIGHT>>\u0995\u09BF\u09B2\u09CB\u09AC\u09BE\u0987\u099F\u09C7\u09B0 \u0995\u09AE \u09B9\u09B2\u09C7 \u09A6\u09CD\u09B0\u09C1\u09A4 \u0986\u09AA\u09B2\u09CB\u09A1 \u09B9\u09DF\u0964 OLX-\u098F \u099B\u09AC\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09BE \u09AB\u09CD\u09B0\u09BF\u0964',
