    'featured_listings.FeaturedListings_Content': '\u09AC\u09C8\u09B6\u09BF\u09B7\u09CD\u099F\u09CD\u09AF\u09AE\u09DF \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8 \u09AA\u09B0\u09BF\u09B7\u09C7\u09AC\u09BE \u0986\u09AA\u09A8\u09BE\u09B0  \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u0995\u09C7 \u09AC\u09C8\u09B6\u09BF\u09B7\u09CD\u099F\u09CD\u09AF\u09AE\u09DF \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8 \u09AC\u09BF\u09AD\u09BE\u0997\u09C7 \u09AA\u09CD\u09B0\u09A6\u09B0\u09CD\u09B6\u09A8\u09C7\u09B0 \u09B8\u09C1\u09AF\u09CB\u0997 \u09A6\u09C7\u09DF, \u09AF\u09BE \u0986\u09AA\u09A8\u09BE\u09B0 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u0995\u09C7 \u09A8\u09BF\u09DF\u09AE\u09BF\u09A4 \u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8\u09C7\u09B0 \u099A\u09C7\u09DF\u09C7 20 \u0997\u09C1\u09A3 \u09AC\u09C7\u09B6\u09BF \u09A6\u09C3\u09B6\u09CD\u09AF\u09AE\u09BE\u09A8 \u0995\u09B0\u09C7!*',
